import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Badges from '../pages/Badges';

function App() {
    return (
        <BrowserRouter>
            <Route path="/badges" component={Badges} />
        </BrowserRouter>
    );
}

export default App;
